import React from 'react';
import Bot from './Bot';

const BotCollection = ({ data, onEnlist }) => {
  if (!data || data.length === 0) {
    // If data is empty or undefined, display a loading message or fallback content
    return <p>Loading...</p>;
  }

  return (
    <div>
      {/* Render the Bot components using the map function */}
      {data.map((bot) => (
        <Bot key={bot.id} bot={bot} onEnlist={onEnlist} />
      ))}
    </div>
  );
};

export default BotCollection;
